import React from 'react'
import ListDetails from './ListDetails'



function AppList (props) {
	const {list} = props
	console.log(props)
	return(
		<div className="box-content">
			{
				this.props.map((item ,clientsInfo ,index)=>{
				return <ListDetails list={item} key = {clientsInfo} infoBack={this.infoDetale}/>
			})}
		</div>
	)
}

export default AppList
